import { connect } from 'react-redux';
import PropTypes from 'prop-types';
import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
} from 'reactstrap';

import Switch from './Switch';
import logo from './white_logo.svg';

class App extends React.Component {
  constructor(props) {
    super(props);
    this.toggle = this.toggle.bind(this);
    this.state = {
      isOpen: true
    };
  }
  toggle() {
    this.setState({
      isOpen: !this.state.isOpen
    });
  }



  render() {
    const { router, moduleMappings } = this.props;
    const displayedRoutes = moduleMappings;
    delete displayedRoutes.home;

    return (
      <div>
        <Navbar className="propNav" light expand="md" fixed="top">
          <NavbarBrand href="/">
            <div>
              <img style={{ height: "50px" }} src={logo} />
            </div>
          </NavbarBrand>
          <NavbarToggler onClick={this.toggle} />
          <Collapse isOpen={this.state.isOpen} navbar>
            <Nav className="ml-auto" navbar>
              {Object.keys(moduleMappings).map(key => (
                <NavItem >
                  <NavLink style={{ color: "white" }} href={moduleMappings[key].path}>{moduleMappings[key].label}</NavLink>
                </NavItem>
              ))}
            </Nav>
          </Collapse>
        </Navbar>
        <div className="pageContainer">
          <Switch moduleMappings={moduleMappings} />
        </div>
      </div>

    );
  }
}

App.propTypes = {
  moduleMappings: PropTypes.objectOf(PropTypes.object).isRequired,
  router: PropTypes.objectOf(PropTypes.object).isRequired,
  isLoggedIn: PropTypes.func.isRequired,
  businessId: PropTypes.string.isRequired,
  businessName: PropTypes.string.isRequired,
};

const mapStateToProps = state => ({
  router: state.router,
});

export default connect(mapStateToProps)(App);
